import React from 'react';
import './Auth.css';

function SignIn() {
  return (
    <div className="auth-container">
      <div className="auth-card">
        <h2>Входf</h2>
        <form>
          <input type="text" placeholder="Логин" />
          <input type="password" placeholder="Пароль" />
          <button type="submit">Войти</button>
        </form>
      </div>
    </div>
  );
}

export default SignIn;
